import React from "react";
import "./Dice.scss"

type DiceProps = {
    header: string,
    options: string[]
}

const Dice: React.FC<DiceProps> = ({header, options}) => {

    const diceRoll = (numberOfDice: number) => {
        let rolls = [];
        for (let i = 0; i < numberOfDice; i++) {
            rolls[i] = Math.floor(Math.random() * 6) + 1;
        }
    };

    return (
        <div className="Dice">
            <h4>{header}</h4>
            <div className="Square">

            </div>
        </div>
    )
};

export default Dice
